query GetAuctionBids($address: String!, $name: String!, $offset: Int!) {
  auctionByAddressAndName(address: $address, name: $name) {
    bidsByAuctionAddressAndAuctionName(first: 10, offset: $offset, orderBy: SUBMITTED_TIMESTAMP_DESC) {
      nodes {
        bidId
        signer
        status
        submittedTimestamp
        tipRevealed
        amount
        __typename
      }
      totalCount
      __typename
    }
    __typename
  }
}
